import "./App.css";
import React from "react";
import { Route as router } from "react-router-dom";
import Principal from "./f_components/f_principal/principal";
function App() {
  return (
    <div className="App">
        <router path="/principal" component={Principal}></router>
    </div>
  );
}

export default App;
